import React from 'react';

function ModalView(props) {
    return (
        <div className={'view-layer-wrap',(props.login ? 'on':'')}>
            <div className='bg'></div>
            <div className='con'>
                <div className='img'></div>
                <div className='txt'></div>
            </div>           
        </div>
    );
}

export default ModalView;
